import { useState, useEffect } from 'react';
import { Card, Typography, Box, Fade } from '@mui/material';
import { keyframes } from '@mui/system';
import SentimentSatisfiedAltIcon from '@mui/icons-material/SentimentSatisfiedAlt';
import SentimentNeutralIcon from '@mui/icons-material/SentimentNeutral';
import SentimentVeryDissatisfiedIcon from '@mui/icons-material/SentimentVeryDissatisfied';

const EmotionChart = ({ history }) => {
  const [hoveredId, setHoveredId] = useState(null);

  const sentimentCounts = history.reduce((acc, item) => {
    acc[item.sentiment] = (acc[item.sentiment] || 0) + 1;
    return acc;
  }, {});

  const total = history.length || 1;
  const getPercentage = (value) => ((value || 0) / total * 100).toFixed(1);

  const data = [
    {
      id: 'positive',
      label: '正面',
      value: sentimentCounts.positive || 0,
      color: '#00DC82',
      icon: <SentimentSatisfiedAltIcon />,
    },
    {
      id: 'neutral',
      label: '中性',
      value: sentimentCounts.neutral || 0,
      color: '#818CF8',
      icon: <SentimentNeutralIcon />,
    },
    {
      id: 'negative',
      label: '负面',
      value: sentimentCounts.negative || 0,
      color: '#FB7185',
      icon: <SentimentVeryDissatisfiedIcon />,
    },
  ].filter(item => item.value > 0);

  // 计算圆环路径
  const createArc = (percentage, startAngle = 0) => {
    const radius = 40;
    const centerX = 50;
    const centerY = 50;
    const angleInRadians = (percentage / 100) * Math.PI * 2;
    const endAngle = startAngle + angleInRadians;

    const startX = centerX + radius * Math.cos(startAngle - Math.PI / 2);
    const startY = centerY + radius * Math.sin(startAngle - Math.PI / 2);
    const endX = centerX + radius * Math.cos(endAngle - Math.PI / 2);
    const endY = centerY + radius * Math.sin(endAngle - Math.PI / 2);

    const largeArcFlag = percentage > 50 ? 1 : 0;

    return `M ${centerX} ${centerY}
            L ${startX} ${startY}
            A ${radius} ${radius} 0 ${largeArcFlag} 1 ${endX} ${endY}
            Z`;
  };

  let currentAngle = 0;

  return (
    <Card
      sx={{
        p: 4,
        minHeight: 400,
        background: 'rgba(17, 25, 40, 0.75)',
        backdropFilter: 'blur(20px)',
        border: '1px solid rgba(255, 255, 255, 0.125)',
      }}
    >
      <Typography
        variant="h6"
        sx={{
          mb: 4,
          textAlign: 'center',
          background: 'linear-gradient(135deg, #36BFFA, #2FD4B6)',
          backgroundClip: 'text',
          WebkitBackgroundClip: 'text',
          WebkitTextFillColor: 'transparent',
          fontWeight: 600,
        }}
      >
        情感分布
      </Typography>

      <Box sx={{ display: 'flex', justifyContent: 'center', mb: 4 }}>
        <Box sx={{ width: 240, height: 240, position: 'relative' }}>
          <svg width="100%" height="100%" viewBox="0 0 100 100">
            {data.map((item) => {
              const percentage = parseFloat(getPercentage(item.value));
              const path = createArc(percentage, currentAngle * Math.PI * 2);
              currentAngle += percentage / 100;

              return (
                <path
                  key={item.id}
                  d={path}
                  fill={item.color}
                  opacity={hoveredId === item.id ? 1 : 0.8}
                  style={{
                    transition: 'all 0.3s ease',
                    cursor: 'pointer',
                  }}
                  onMouseEnter={() => setHoveredId(item.id)}
                  onMouseLeave={() => setHoveredId(null)}
                />
              );
            })}
            <circle
              cx="50"
              cy="50"
              r="25"
              fill="rgba(17, 25, 40, 0.95)"
              stroke="rgba(255, 255, 255, 0.1)"
            />
          </svg>
        </Box>
      </Box>

      <Box
        sx={{
          display: 'flex',
          justifyContent: 'center',
          flexWrap: 'wrap',
          gap: 2,
        }}
      >
        {data.map((item) => (
          <Fade key={item.id} in timeout={500}>
            <Box
              sx={{
                display: 'flex',
                alignItems: 'center',
                gap: 1,
                padding: '8px 16px',
                borderRadius: '12px',
                cursor: 'pointer',
                transition: 'all 0.3s ease',
                background: hoveredId === item.id
                  ? item.color
                  : 'rgba(255, 255, 255, 0.05)',
                color: hoveredId === item.id ? '#fff' : 'text.primary',
                '&:hover': {
                  background: item.color,
                  color: '#fff',
                  transform: 'translateY(-2px)',
                },
              }}
              onMouseEnter={() => setHoveredId(item.id)}
              onMouseLeave={() => setHoveredId(null)}
            >
              {item.icon}
              <Typography sx={{ fontWeight: 500 }}>
                {item.label}: {getPercentage(item.value)}%
              </Typography>
            </Box>
          </Fade>
        ))}
      </Box>
    </Card>
  );
};

export default EmotionChart;
